INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (1, 105, "仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 1.5, 110, 122601, 1, 0, 160, 1, 0.029, 0, 101, 1);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 111, "太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 2.5, 105, 122401, 3, 0, 120, 2, 0.014, 1, 102, 2);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 105, "波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 2.5, 110, 122501, 2, 1, 350, 3, 0.017, 0, 103, 3);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 105, "海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 1.5, 110, 107501, 3, 0, 130, 4, 0.016, 1, 104, 4);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (1, 105, "海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 2.5, 110, 107601, 1, 0, 160, 5, 0.014, 0, 105, 5);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 103, "水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 3.5, 120, 107801, 2, 1, 255, 6, 0.029, 0, 106, 6);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (1, 103, "優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 3.5, 120, 110601, 1, 0, 160, 7, 0.013, 0, 107, 7);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 103, "浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 2.5, 110, 110401, 2, 1, 350, 8, 0.014, 0, 108, 8);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 100, "浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 1.5, 105, 110501, 3, 0, 130, 9, 0.012, 1, 109, 9);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (1, 103, "浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 2.5, 105, 115701, 1, 0, 200, 10, 0.014, 0, 110, 10);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 103, "再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 2.5, 105, 113601, 2, 1, 350, 11, 0.071, 0, 111, 11);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 103, "水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 1.5, 120, 107901, 3, 0, 130, 12, 0.014, 1, 112, 12);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (1, 105, "バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 1.5, 110, 108001, 2, 0, 200, 13, 0.022, 0, 113, 13);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (1, 108, "真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 2.5, 110, 110301, 1, 0, 160, 14, 0.031, 0, 114, 14);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 105, "海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 0.5, 110, 107701, 1, 0, 130, 15, 0.036, 1, 115, 15);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 95, "粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 3.5, 110, 113101, 2, 1, 350, 16, 0.048, 0, 116, 16);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 105, "夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 1.5, 105, 113301, 3, 0, 130, 17, 0.043, 1, 117, 17);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 95, "海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 1.5, 105, 113201, 2, 0, 130, 18, 0.018, 1, 118, 18);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (1, 108, "夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 2.5, 110, 117001, 2, 0, 160, 19, 0.021, 0, 119, 19);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 105, "青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 2.5, 110, 113501, 1, 1, 255, 20, 0.036, 0, 120, 20);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 105, "笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 2.5, 105, 113401, 3, 1, 350, 21, 0.02, 0, 121, 21);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 105, "海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 2.5, 110, 110101, 1, 0, 130, 22, 0.018, 1, 122, 22);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (1, 111, "水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 3.5, 105, 110001, 3, 0, 160, 23, 0.03, 0, 123, 23);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 103, "南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 1.5, 110, 117201, 1, 0, 130, 24, 0.027, 1, 124, 24);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (1, 108, "海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 3.5, 105, 117301, 2, 0, 160, 25, 0.02, 0, 125, 25);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 105, "夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 2.5, 110, 117401, 3, 1, 350, 26, 0.04, 0, 126, 26);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 105, "向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 3.5, 110, 117101, 1, 1, 350, 27, 0.009, 0, 127, 27);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 105, "渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 3.5, 120, 122901, 1, 1, 255, 28, 0.022, 0, 128, 28);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 105, "無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 2.5, 110, 122801, 3, 0, 130, 29, 0.028, 1, 129, 29);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (1, 108, "海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 3.5, 105, 122701, 2, 0, 130, 30, 0.023, 0, 130, 30);
